from typing import List


def concatenate(strings: List[str]) -> str:
    """ Concatenate list of strings into a single string
    >>> concatenate([])
    ''
    >>> concatenate(['a', 'b', 'c'])
    'abc'
    """
    if len(strings) == 1:
        return strings[0]
    elif len(strings) == 2:
        return strings[0] + strings[1:]
    else:
        return ''.join(strings)
